(451174, 'vi', '', NULL, NULL, NULL, '', NULL, 'Invitation to participate in a survey', 'Dear {FIRSTNAME},<br />\n<br />\nyou have been invited to participate in a survey.<br />\n<br />\nThe survey is titled:<br />\n"{SURVEYNAME}"<br />\n<br />\n"{SURVEYDESCRIPTION}"<br />\n<br />\nTo participate, please click on the link below.<br />\n<br />\nSincerely,<br />\n<br />\n{ADMINNAME} ({ADMINEMAIL})<br />\n<br />\n----------------------------------------------<br />\nClick here to do the survey:<br />\n{SURVEYURL}<br />\n<br />\nNếu bạn không muốn tham gia khảo sát này nữa và không muốn nhận bất kì thư mời nào, vui lòng click liên kết sau: <br />\n{OPTOUTURL}<br />\n<br />\nIf you are blacklisted but want to participate in this survey and want to receive invitations please click the following link:<br />\n{OPTINURL}', 'Reminder to participate in a survey', 'Chào {FIRSTNAME},<br />\n<br />\nHiện tại, chúng tôi đã mời bạn tham gia vào một khảo sát.<br />\n<br />\nChúng tôi lưu ý rằng bạn chưa hoàn thành cuộc khảo sát, và muốn nhắc nhở bạn rằng cuộc khảo sát vẫn tồn tại nếu bạn muốn tham gia.<br />\n<br />\nTiêu đề của khảo sát:<br />\n"{SURVEYNAME}"<br />\n<br />\n"{SURVEYDESCRIPTION}"<br />\nĐể tham gia, vui lòng click liên kết bên dưới.<br />\n<br />\nTrân trọng,<br />\n<br />\n{ADMINNAME} ({ADMINEMAIL})<br />\n<br />\n----------------------------------------------<br />\nClick vào đây để làm khảo sát:<br />\n{SURVEYURL}<br />\n<br />\nNếu bạn không muốn tham gia khảo sát này nữa và không muốn nhận bất kì thư mời nào, vui lòng click liên kết sau: <br />\n{OPTOUTURL}', 'Xác nhận đang kí khảo sát', 'Chào {FIRSTNAME},<br />\n<br />\nBạn, hoặc ai đó sử dụng địa chỉ email của bạn để đăng kí tham gia vào khảo sát có tiêu đề {SURVEYNAME}.<br />\n<br />\nĐể hoàn thành khảo sát này, click vào URL bên dưới:<br />\n<br />\n{SURVEYURL}<br />\n<br />\nNếu bạn có bất kì câu hỏi nào về khảo sát này, hoặc nếu bạn không đăng kí tham gia và nghĩ rằng có lỗi, vui lòng liên hệ {ADMINNAME} 