(451174, 'ja', '', NULL, NULL, NULL, '', NULL, 'アンケートの御案内', '{LASTNAME}さま <br />\n<br />\nこの度私どもでは、下記のアンケート調査を実施いたします。<br />\nぜひ{LASTNAME}さまに御参加いただきたく、御案内申し上げます。<br />\n<br />\n今回の調査のタイトルは、<br />\n<br />\n「{SURVEYNAME}」<br />\n　{SURVEYDESCRIPTION}<br />\n<br />\nです。<br />\n<br />\n下記のリンクをクリックすれば、回答ページが開きます。<br />\n{SURVEYURL}<br />\n<br />\nどうぞよろしくお願いいたします。<br />\n<br />\n----------------------------------------<br />\n{ADMINNAME}（{ADMINEMAIL}）<br />\n<br />\nもし、このアンケートに参加したくない場合、また今後これ以上案内メールを受信したくない場合は、次のリンクをクリックしてください。 リンク:<br />\n{OPTOUTURL}<br />\n<br />\nもしあなたがブラックリストに追加されているが、このアンケートに参加したい、案内を受取りたい場合には、次のリンクをクリックしてください：<br />\n{OPTINURL}', 'アンケート参加の御案内', '{LASTNAME} さま <br />\n<br />\n先日、私どもから{LASTNAME}さま宛に<br />\nアンケート調査の御案内のメールをお送りいたしましたが、<br />\n{LASTNAME}さまの御回答はまだ頂いていないようです。<br />\nまだ回答可能ですので、ぜひ御参加下さいますようお願いいたします。<br />\n<br />\n（万一行き違いの場合には御容赦下さい。）<br />\n<br />\n今回の調査のタイトルは、<br />\n<br />\n「{SURVEYNAME}」<br />\n　{SURVEYDESCRIPTION}<br />\n<br />\nです。<br />\n下記のリンクをクリックすれば、回答ページが開きます。<br />\n{SURVEYURL}<br />\n<br />\nよろしくお願いいたします。<br />\n<br />\n----------------------------------------------<br />\n{ADMINNAME} ({ADMINEMAIL})<br />\n<br />\nもし、このアンケートに参加したくない場合、また今後これ以上案内メールを受信したくない場合は、次のリンクをクリックしてください。 リンク:<br />\n{OPTOUTURL}', 'アンケート登録確認', '{LASTNAME}さま<br />\n<br />\nこの度、{LASTNAME}さま（もしくは、このメールアドレスを利用された方）は、<br />\nインターネット上のアンケート調査「{SURVEYNAME}」に参加登録されました。<br />\n<br />\n下記のリンクをクリックすれば、回答ページが開きます。<br />\n{SURVEYURL}<br />\n<br />\nもし今回の調査およびこのメールに関して御不明な点などございましたら、<br />\n{ADMINNAME} （ {ADMINEMAIL}）まで御連絡下さい。<br />\n<br />\nよろしくお願いいたします。<br />\n<br />\n----------------------------------------------<br />\n{ADMINNAME} ({ADMINEMAIL})', 'アンケートの御案内', '{LASTNAME} さま <br />\n<br />\nこのメールは、{LASTNAME}さまが、<br />\n調査「{SURVEYNAME}」に回答していただいたことを確認するものです。<br />\n｛LASTNAME｝さまの御回答は、確かに保存されました。<br />\nこの度は調査に御協力いただき、まことにありがとうございました。<br />\n<br />\nもし今回の調査およびこのメールに関して御不明な点などございましたら、<br />\n{ADMINNAME} （ {ADMINEMAIL}）まで御連絡下さい。<br />\n<br />\n今後ともよろしくお願いいたします。<br />\n<b